//import React from 'react'
import { useState, useEffect, memo } from "react";

const useFilter = (url) => {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    const fetchTodos = async () => {
      const res = await fetch(url);
      const data = await res.json();
      let arr = [];
      for(let key in data){
        arr.push({
          id: key,
          email: key.email,
          flight:key.flight
        })
      }
      console.log();
      console.log(arr);
      setTodos(arr);
    
    };
    fetchTodos();
  }, [url]);

  return [todos];
};

export default useFilter;
